import React, { useEffect, useState } from "react";

function Home() {
  const [location, setLocation] = useState([]);
  console.log(location);
  useEffect(() => {
    fetch("/data.json")
      .then((response) => response.json())

      .then((data) => {
        setLocation(data);
      });
  }, []);
  return <div></div>;
}

export default Home;
